import React from 'react';
import "./Formation.scss";
import oclock from '../../images/oclock.png';
import toeic from '../../images/toeic.png';

const Formation = () => {
  return (
    <div className='formation'>
        <p className='formation-subtitle'>
            FORMATIONS
        </p>

    <div className='formation-bloc'>
        <div className='formation-prepic'>
            <img className='formation-pic' src={oclock}/>
        </div>
        <p className='formation-content'> Formation O'clock</p>
    </div>

    <div className='formation-bloc'>
        <div className='formation-prepic'>
            <img className='formation-pic' src={toeic}/>
        </div>
        <p className='formation-content'> Formation O'clock</p>
    </div>
    </div>
  )
}

export default Formation
